import { useState } from 'react';
import './App.css';
import Navbar from "./components/Navbar";
// import About from "./components/Abouter"; 
import TextForm from "./components/TextForm";

function App() {
  const [darker,setdarker]=useState('dark');
  const toggler=()=>{
    if(darker==='Light'){
      setdarker('dark');
    }
    else{
      setdarker('Light')
    }

  }
  return (
    <> 
  <Navbar title="TextUtils" Abouttext="About" mode={darker} toggle={toggler}/>
  <div className="container my-3">
    <TextForm heading="TextUtils"/>
    {/* <About/> */}
  </div>
</>
  );
}
export default App;
